-- XOR decryptor
local function BTyYKg(a,b)
    local r=0
    for i=0,7 do
        local x = a % 2
        local y = b % 2
        if x ~= y then r = r + 2^i end
        a = math.floor(a/2)
        b = math.floor(b/2)
    end
    return r
end

